const summary = ()=>{
    return(
        <>
        <div className="aboutsummary-wrp">
            <div className='cmn-heading container'>
            <div class="mt-separator-outer separator-left">
            <div class="mt-separator">
            <h3 class="text-uppercase sep-line-one"><span>About</span>Summary</h3>
            </div>
            </div>
            </div>
        </div>
        </>
    )
}
export default summary;
